export const WhatWeDo = function(props) {
  return (
    <div className="w-full h-full flex justify-center items-center">
      <img className="object-contain" src="../static/images/bg-one.png" />
      <div className="z-10 flex flex-col">
        <p className="text-center text-6xl font-display">WHAT WE DO</p>
        <button className="font-body text-4xl p-4 bg-darkpink">
          Learning Labs
        </button>
        <button>Exploration Labs</button>
        <button>Sunday Sessions</button>
      </div>
    </div>
  );
};
